import React from "react";
import "./css/App.scss";

// Components
import Header from "./components/Header/Header.js";
import { AppBar } from "@material-ui/core";
import classes from "*.module.css";

function App() {
    return (
        <>
            <div className="App">
                {/* Navigation Bar */}
                <AppBar>
                    <IconButton
                        edge="end"
                        className={classes.menuButton}
                        color="inherit"
                        aria-label="menu"
                    >
                        <MenuIcon />
                    </IconButton>
                </AppBar>
            </div>
        </>
    );
}

export default App;
